import { useEffect, useState } from "react";
import "./App.css";

function Users() {
  const [user, setUser] = useState([]);
  useEffect(() => {
    fetch("http://localhost:8081/users")
      .then((res) => res.json())
      .then((json) => {
        if (json.length > 0) {
          setUser(json);
        }
      });
  }, []);
  return (
    <div className="Users">
      <table>
        {user?.map((item, i) => {
          return (
            <tr>
              <td>{item.username}</td>
              <td> {item.email}</td>
            </tr>
          );
        })}
      </table>
    </div>
  );
}

export default Users;
